import React, {Component} from 'react';
import ReduxHOC from "../src/components/reduxHOC";

class User extends Component  {
    render() {

        return (
            <div style={{backgroundColor:'red'}}>
                Gajinooooooooooooooooooooooooooo
            </div>
        );
    }
}

export default ReduxHOC(User);
